import React from 'react';
import Navbar from '../../parcials/Navbar';
import {
    MDBCard,
    MDBCardBody,
    MDBContainer,
    MDBRow,
    MDBInputGroup
} from 'mdbreact';

const TransferSystemPage = () => {
    return (
        <Navbar>
            <br></br>
            <MDBContainer>
                <MDBCard>
                    <MDBCardBody>
                        <MDBRow>
                        <MDBCol md='6'>
                            <MDBInput label='Type your password' icon='lock' group type='password' validate />
                        </MDBCol>
                        </MDBRow>
                    </MDBCardBody>
                </MDBCard>
            </MDBContainer>
        </Navbar>
    )
}

export default TransferSystemPage;
